def GC_visualize(seqs):
    m1 = TE_predictor.predictor()
    m2 = Deg_predictor.predictor()
    TEs = []
    Degs = []
    GCs = []
    for seq in seqs:
        GC = 0
        for i in range(0, len(seq)):
            if seq[i] == 'G' or seq[i] == 'C':
                GC += 1
        gc_percent = GC / len(seq)

        TEs.append(m1.predict(seq))
        Degs.append(Deg_predictor.score_sum(m2.predict(seq), label='deg_50C'))
        GCs.append(gc_percent)

    import matplotlib.cm as cm
    sc = plt.scatter(TEs, Degs, c=GCs, cmap=cm.coolwarm)
    plt.colorbar(sc).set_label('GC content')
    plt.xlabel('TE')
    plt.ylabel('Deg')
    plt.savefig('img/GC_visualize.png')
    exit()


def vs_target(samples):
    import seaborn as sns
    import matplotlib.pyplot as plt

    n = len(samples)
    data = []

    m1 = TE_predictor.predictor()
    m2 = Deg_predictor.predictor()
    labels = ['NSGA3+cxUniform1', 'NSGA3+cxUniform2', 'NSGA3+cxTwoPoint', 'NSGA2+cxUniform', 'NSGA2+cxTwoPoint']

    for i, (seqs, label) in enumerate(zip(samples, labels)):
        for seq in seqs:
            te = m1.predict(seq)
            deg = Deg_predictor.score_sum(m2.predict(seq), label='deg_50C')
            data.append((te, deg, label))

    # DataFrameに変換
    import pandas as pd
    df = pd.DataFrame(data, columns=['TE', 'Deg', 'Algorithm'])

    # Seabornでプロット
    plt.figure(figsize=(8, 6))
    sns.scatterplot(data=df, x='TE', y='Deg', hue='Algorithm', palette='tab10', alpha=0.9, s=20)

    plt.xlabel('TE')
    plt.ylabel('Deg')
    plt.legend()
    plt.savefig('img/all_visualize.png')
    exit()


